	"com/sap/ua/Gateway_352/view/Map.view.html":'<!DOCTYPE html>\r\n\t<html>\r\n    <script\r\n      src="https://maps.googleapis.com/maps/api/js?key=AIzaSyCO56qrt0K4xLwkVAwJ3o9JZeCNuKnIOIo &callback=codeAddress&libraries=&v=weekly" defer></script>\r\n    <!-- jsFiddle will insert css and js -->\r\n    <script>\r\n        var map;\r\n        var geocoder;\r\n\t\tvar address;\r\n\r\n        function codeAddress() {\r\n        \t//Set the address to draw in the map\r\n            address = "2407, McKinney Ave, Dallas, USA";\r\n            geocoder = new google.maps.Geocoder();\r\n            map = new google.maps.Map(document.getElementById("map"), {\r\n                zoom: 15,\r\n            });\r\n            geocoder.geocode({ \'address\': address }, function (results, status) {\r\n                if (status == google.maps.GeocoderStatus.OK) {\r\n                    map.setCenter(results[0].geometry.location);\r\n                    var marker = new google.maps.Marker({\r\n                        map: map,\r\n                        position: results[0].geometry.location\r\n                    });\r\n                    console.log(results[0].geometry.location);\r\n                } else {\r\n                    console.log(\'Geocode was not successful for the following reason: \' + status);\r\n                }\r\n            });\r\n        }\r\n    </script>\r\n    <style>\r\n        /* Set the size of the div element that contains the map */\r\n        #map {\r\n        height: 400px;\r\n        /* The height is 400 pixels */\r\n        width: 100%;\r\n        /* The width is the width of the web page */\r\n        }\r\n    </style>\r\n    <!--The div element for the map -->\r\n    <div id="map"></div>\r\n</html>\r\n',
